function run_test(dataset, m1label, m2label, x1, x2)
fprintf('\n\n%s: %s versus %s\n',dataset, m1label, m2label)
fprintf('%s mean = %.4f     %s mean = %.4f\n', m1label, mean(x1), m2label, mean(x2))
[h,p,ci,stats]=ttest(x1,x2);
fprintf('t(%d)=%f, p=%f\n',stats.df, abs(stats.tstat), p);

